val predictors = Array("Lot Area", "Year Built", "1st Flr SF", "2nd Flr SF", "Full Bath", "Bedroom AbvGr", "TotRms AbvGrd")

// Select our predictors as well as the column we want to predict.
val data = iowaData.select("SalePrice", predictors: _*)

import org.apache.spark.ml.regression.{DecisionTreeRegressor, DecisionTreeRegressionModel}
import org.apache.spark.ml.feature.VectorAssembler

// First we use VectorAssembler to transform our chosen predictors into a single column called features.
val assembler = new VectorAssembler().setInputCols(predictors).setOutputCol("features")
val transformedData = assembler.transform(data)

// Initialize a decision tree regressor and set the column to predict
val dctRegressor = new DecisionTreeRegressor().setLabelCol("SalePrice").setSeed(0)

// Fit the model to our data
val firstModel = dctRegressor.fit(transformedData)

