val imputer = new Imputer().setInputCols(nullCols.map(x => x.name).toArray).setOutputCols(nullCols.map(x => x.name).toArray)
val indexers = categoricalCols.map(x => new StringIndexer().setInputCol(x.name).setOutputCol(x.name + "_index"))
val encoder = new OneHotEncoderEstimator().setInputCols(categoricalCols.map(x => x.name + "_index").toArray).setOutputCols(categoricalCols.map(x => x.name + "_encoded").toArray)
val assembler = new VectorAssembler().setInputCols(trainData.drop(Array("Order", "SalePrice") ++ categoricalCols.map(x => x.name) ++ categoricalCols.map(x => x.name + "_index"): _*).columns).setOutputCol("features")
val gbtRegressor = new GBTRegressor().setLabelCol("SalePrice").setSeed(0).setMaxIter(10)

// Collect these into an array of stages in the correct order.
val stages = Array(imputer) ++ indexers ++ Array(encoder, assembler, gbtRegressor)

// Create the pipeline and set the stages.
val pipe = new Pipeline().setStages(stages)

// Fit the model using the pipeline.
val model = pipe.fit(trainData)

import org.apache.spark.ml.tuning.{CrossValidator, ParamGridBuilder}

// We first make a grid of hyperparameters to tune over
val paramGrid = new ParamGridBuilder().addGrid(gbtRegressor.maxDepth, (4 to 6).toArray).addGrid(gbtRegressor.maxBins, (30 to 34).toArray).build()

